// product.js
const product = {
  name: "Smartphone Ultra",
  price: "799€",
  description: "Un smartphone dernier cri avec toutes les fonctionnalités modernes.",
  image: "https://images.unsplash.com/photo-1510552776732-03e61cf4b144?auto=format&fit=crop&w=300&q=80", // image par défaut
  images: [
    "https://images.unsplash.com/photo-1510552776732-03e61cf4b144?auto=format&fit=crop&w=300&q=80",
    "https://images.unsplash.com/photo-1580910051073-d7b32d1ac49d?auto=format&fit=crop&w=300&q=80",
    "https://images.unsplash.com/photo-1580894732444-2f1f20a1ce88?auto=format&fit=crop&w=300&q=80",
    "https://images.unsplash.com/photo-1512499617640-c2f9992c2b69?auto=format&fit=crop&w=300&q=80"
  ]
};

export default product;
